import ReactDOM from "react-dom";
import { App } from "./app";
import "./styles/styles.css";
import Auth0Provider from "@auth0/auth0-react";

ReactDOM.render(
  <React.StrictMode>
    <Auth0Provider>
      <App />
    </Auth0Provider>
  </React.StrictMode>,
  document.getElementById("root")
